import "./nav.css";

const props = ["Home", "AboutAs", "Contact"]

export default function nave(props){ 
   const {Home, AboutAs ,Contact} = props; 
    return (
        <ul>
         {
          props.map(e => {
            return <li>{e}</li>;
          })
        }
        </ul>
    )
}
